import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom';
import axios from '../../utils/axios';
import { format,parseISO, formatDistance, formatRelative, subDays } from 'date-fns'

export default function ReadEvent() {

    const { id_owner, id_counter } = useParams();
    const [event_time, setEvent_time] = useState('')
    //useEffect for get
    //obtener dato de los parametros

    useEffect(() => {

        const getProcedure = async () => {

            const procedure = await axios.get(`/api/events/${id_counter}/${id_owner}`);
            console.log('procedure', procedure)
            const localDate = parseISO(procedure.data[0]._event_time);
            console.log( 'format to now',format(localDate, 'MMMM dd, yyyy, EEEE, hh:mm aaa')  )

            setEvent_time(format(localDate, 'MMMM dd, yyyy, EEEE, hh:mm aaa'))
        }
        getProcedure()


    }, [id_owner, id_counter])
    return (
        <div>
            {event_time}
        </div>
    )
};
